package com.aebiz.b2b2c.servicestaff.servicestaffcomb.vo;import com.aebiz.b2b2c.baseframework.basecrud.vo.BaseModel;import com.aebiz.b2b2c.servicestaff.servicestaff.vo.ServicestaffModel;import com.aebiz.b2b2c.servicestaff.servicestaffinfo.vo.ServicestaffinfoModel;import com.aebiz.b2b2c.servicestaff.servicestafflevel.vo.ServicestafflevelModel;/** *  * @author hedongfei * */public class ServicestaffcombModel  extends BaseModel{	/* 家政员信息信息 */	private ServicestaffModel servicestaffModel = new ServicestaffModel();	/* 家政员基础信息*/	private ServicestaffinfoModel  servicestaffinfoModel = new ServicestaffinfoModel();	/* 平台家政员等级信息 */	private ServicestafflevelModel servicestafflevelModel = new ServicestafflevelModel();		public ServicestaffModel getServicestaffModel() {		return servicestaffModel;	}	public void setServicestaffModel(ServicestaffModel servicestaffModel) {		this.servicestaffModel = servicestaffModel;	}	public ServicestaffinfoModel getServicestaffinfoModel() {		return servicestaffinfoModel;	}	public void setServicestaffinfoModel(ServicestaffinfoModel servicestaffinfoModel) {		this.servicestaffinfoModel = servicestaffinfoModel;	}	public ServicestafflevelModel getServicestafflevelModel() {		return servicestafflevelModel;	}	public void setServicestafflevelModel(			ServicestafflevelModel servicestafflevelModel) {		this.servicestafflevelModel = servicestafflevelModel;	}			@Override	public String toString() {		return "ServicestaffcombModel [servicestaffModel=" + servicestaffModel				+ ",servicestaffinfoModel=" + servicestaffinfoModel				+ ", servicestafflevelModel=" + servicestafflevelModel + "]";	}}